import { Fragment } from 'react';
import './App.css';
import {Laptop, Wrapper} from './Laptop';

function App() {
  return(
    <Fragment>
       <Laptop brand="Samsong"/>
      <Laptop />
    <Wrapper>
      <Laptop brand="Samsong"/>
      <Laptop />
    </Wrapper>
    </Fragment>
  )
}

export default App;
